// version info for migration info
const CONTRACT_NAME: &str = "crates.io:zk-cw";
const CONTRACT_VERSION: &str = env!("CARGO_PKG_VERSION");

pub const GROTH16_PROOF_LENGTH_BYTES: usize = 192;

#[derive(Clone, Debug)]
pub struct SillyProof([u8; GROTH16_PROOF_LENGTH_BYTES]);

#[derive(Debug, thiserror::Error)]
pub enum VerificationError {
    #[error("error deserializing compressed proof: {0:?}")]
    ProofDeserialize(ark_serialize::SerializationError),
    #[error("error verifying proof: {0:?}")]
    SynthesisError(ark_relations::r1cs::SynthesisError),
    #[error("silly proof did not verify")]
    InvalidProof,
}

impl SillyProof {
    pub fn verify(&self, vk: &PreparedVerifyingKey<Bls12_381>) -> Result<(), VerificationError> {
        let proof = Proof::deserialize_compressed_unchecked(&self.0[..])
            .map_err(VerificationError::ProofDeserialize)?;

        let input = <Bls12_381 as Pairing>::ScalarField::from_str(
            "25300566374230738148712118529632897789764870854306008015158982295953556789665",
        )
        .unwrap();

        Groth16::<Bls12_381, LibsnarkReduction>::verify_with_processed_vk(vk, &[input], &proof)
            .map_err(VerificationError::SynthesisError)?
            .then_some(())
            .ok_or(VerificationError::InvalidProof)
    }
}

#[cfg_attr(not(feature = "library"), entry_point)]
pub fn instantiate(
    deps: DepsMut,
    _env: Env,
    info: MessageInfo,
    _msg: InstantiateMsg,
) -> Result<Response, ContractError> {
    let state = State {
        owner: info.sender.clone(),
    };
    set_contract_version(deps.storage, CONTRACT_NAME, CONTRACT_VERSION)?;
    STATE.save(deps.storage, &state)?;

    Ok(Response::new()
        .add_attribute("method", "instantiate")
        .add_attribute("owner", info.sender))
}

#[cfg_attr(not(feature = "library"), entry_point)]
pub fn execute(
    _deps: DepsMut,
    _env: Env,
    _info: MessageInfo,
    msg: ExecuteMsg,
) -> Result<Response, ContractError> {
    match msg {
        ExecuteMsg::Verify {} => execute::verify(),
    }
}

pub mod execute {
    use super::*;

    use cosmwasm_std::HexBinary;

    pub fn verify() -> Result<Response, ContractError> {
        let proof_bytes = HexBinary::from_hex("").unwrap();
        let proof = SillyProof(proof_bytes.to_array().unwrap());

        let pvk_bytes = HexBinary::from_hex("").unwrap();
        let pvk = PreparedVerifyingKey::deserialize_compressed(pvk_bytes.as_slice()).unwrap();
        let _ = proof.verify(&pvk);

        Ok(Response::new().add_attribute("action", "verify"))
    }
}

